Dead End Kid Gabriel Dell appears in &quot;the Wife of Frankenstein&quot;, also starring, Tony Bennet, Caroline Richter, Monica Zetterlund, Jayne Meadows, regulars include Louis Nye, Gabe Dell, Bill Dana.

color timing strip on screen

